bioghist.p:
De taak van de Agent bestond uit:


de zorg voor de beleningen, voor rekening van het Amortisatie Syndicaat en het ministerie van Financiën gesloten, en voor effecten die tot onderpand dienen;

de administrate der achterstallige vorderingen van 1809 en vroeger;

de aflossing van voorschotten verstrekt uit het fonds van acht miljoen voor de Watersnood van 1825;

de bewaring van 41/2 %-schuldbekentenissen en domeinlosrenten voor de kopers van domeinen, die zekerheid gesteld hadden voor de betaling;

de bewaring van schuldbekentenissen, kwitanties, promessen, etc. door debiteuren van het fonds der nationale nijverheid afgegeven;

de bewaring van de archieven van het Amortisatie Syndicaat, voor zover niet de domeinen betreffende;

de uitvoering der wet van 27 September 1841 (Stbl. 35) tot vervroegde omzetting van de uitgestelde schuld in werkelijke schuld.

De Agent voert een aantal van de taken namens de minister uit. 
De belangrijkste taken van de Agent op het beleidsterrein waren:

uitgeven, registreren en aflossen van staatsleningen;


op de hoogte blijven van de stand van zaken op de geld- en kapitaalmarkt;

maandelijks verslag uitbrengen aan de minister van Financiën over de inkomsten en uitgaven van het Agentschap;

jaarlijks verslag uitbrengen aan de minister van Financiën over de bedrijfsvoering van het Agentschap.


voorbereiden van wettelijke regelingen en beleid op de geld- en kapitaalmarkt;

ontwikkelen en beoordelen van leningsystemen;


voorbereiden en opstellen van de Begroting van de Nationale Schuld.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 

U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;

Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;

In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;

Vervolgens bevestigt u uw reservering door deze te versturen.
